import ReactCalendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';

export default function Calendar({ selectedDate, onSelectDate }) {
  return (
    <ReactCalendar
      onChange={onSelectDate}
      value={selectedDate}
    />
  );
}
